app.use(express.static("public"));
app.use(express.json());
app.use(express.urlencoded({ extended: true }));

//Init routes
initRoutes(app);

app.listen(port, hostname, ()=> {
  console.log(`Hello Hoang Tran,I am running at ${hostname}:${port}/` )
});

